import React from "react";
import "./Projects.css";

const projects = [
  {
    title: "Portfolio Website",
    description:
      "Personal portfolio built using React. Clean UI, smooth scroll, responsive layout and reusable components.",
    link: "https://github.com/stuti908/portfolio.12",
  },
  {
    title: "E-Commerce App",
    description:
      "Full-featured online shopping platform with cart system and payment integration.",
    link: "https://github.com/your-username/ecommerce-app",
  },
  {
    title: "College Navigation System",
    description:
      "Campus navigation system helping students locate classes, labs, and departments easily.",
    link: "https://github.com/your-username/college-navigation-system",
  },
  {
    title: "Hardware Communication",
    description:
      "RS485–RS232 / UART based byte-level communication between embedded modules.",
    link: "https://github.com/your-username/hardware-communication",
  },
  {
    title: "Offline Chess Game",
    description:
      "Console-based chess game with move validation and two-player mode.",
    link: "https://github.com/stuti908/",
  },
];

const Projects = () => {
  return (
    <section className="projects" id="projects">
      <div className="projects-container">
        <h2 className="projects-title">My Projects</h2>

        <div className="projects-grid">
          {projects.map((project, index) => (
            <a
              key={index}
              href={project.link}
              target="_blank"
              rel="noopener noreferrer"
              className="project-card"
            >
              <h3>{project.title}</h3>
              <p>{project.description}</p>
              <span className="project-link">View Project →</span>
            </a>
          ))}
        </div>
      </div>
    </section>
  );
};

export default Projects;
